  \"2016-05-25T00:43:25.526489\",\n\t\"name\": \"automated-budget-system\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Automated Budget System (ABS) automates
  management and planning of the Mike Monroney Aeronautical Center (MMAC) budget by
  providing enhanced capability to plan, track, query, and report all aspects of the
  budget execution process.  This system has been operational since FY94.  This system
  eliminated the need for paper copies, provided standardization, and eliminated duplicate
  keystroking.  This system ensures everyone is working with/from the same numbers
  at all times.  ABS is scheduled to be sunset when functionality is available through
  DELPHI or another Agency-wide system.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
